export const NAME_LOADING = "POKEMON_LOADING";
export const Name_FAIL = "POKEMON_FAIL";
export const Name_SUCCESS = "POKEMON_SUCCESS";

export type NameType = {
  Gender: Gendername,
  Country: Countryname,
  Name: Name
}

export type Gendername = {
  Gender: string

}

export type Countryname = {
  Country: string
}
export type Name = {
  Name: string
}




export interface NameLoading {
  type: typeof POKEMON_LOADING
}

export interface NameFail {
  type: typeof POKEMON_FAIL
}

export interface NameSuccess {
  type: typeof POKEMON_SUCCESS,
  payload: NameType
}

export type PokemonDispatchTypes = PokemonLoading | PokemonFail | PokemonSuccess
